import React, { useState } from "react";
import axios from "axios";

const Radio = ({ type, setType }) => {
  return (
    <div>
      <div>
        <label>
          <input
            type="radio"
            name="radio"
            checked={type}
            onChange={() => setType(!type)}
          />
          Title
        </label>
      </div>
      <div>
        <label>
          <input
            type="radio"
            name="radio"
            checked={!type}
            onChange={() => setType(!type)}
          />
          Author
        </label>
      </div>
    </div>
  );
};

const Home = ({ useQuery }) => {
  const [type, setType] = useState(true);
  const [val, setVal] = useState("");
  const [next, setNext] = useState(1);
  const fetchData = async () => {
    let url = "https://openlibrary.org/search.json";
    let parameters = {
      limit: 10,
      page: next,
    };
    if (type) {
      delete parameters.author;
      parameters.title = val;
    } else {
      delete parameters.title;
      parameters.author = val;
    }
    const response = await axios.get(url, {
      params: parameters,
    });
    return response;
  };

  const { isLoading, data, isError, error, refetch, isFetching } = useQuery(
    ["Books", next, val],
    fetchData,
    {
      enabled: false,
      refetchOnWindowFocus: false,
    }
  );
  useEffect(() => {
    refetch();
  }, [next, refetch]);
  if (isError) {
    console.log(error);
  }
  console.log(data);
  const handleSearch = (boolean) => {
    if (boolean) {
      setNext(next + 1);
    } else if (next > 1) {
